import React from 'react';

const Certificates = () => {
  const certs = [
    'IBM AI Fundamentals – Feb 2025',
    'Accenture Software Engineering Job Simulation – Jan 2025',
    'AWS Academy Cloud Foundations – Dec 2024',
    'Cisco Introduction to Networks – May 2024',
    'Palo Alto Cybersecurity – Jan 2025',
    'Frontend Web Developer – Infosys',
  ];

  return (
    <section id="certificates" className="text-white py-16 px-8">
      <div className="max-w-5xl mx-auto text-center">
        <h2 className="text-4xl font-bold text-primary mb-8">Certificates</h2>
        <ul className="space-y-3">
          {certs.map((cert, i) => (
            <li key={i} className="text-gray-300">{cert}</li>
          ))}
        </ul>
      </div>
    </section>
  );
};

export default Certificates;
